var _renderer  = new TargetRenderer(0, .5, .5, 1000);

var _prerender_n_touch = _renderer.prerender(_renderer.allGray150, _renderer.allGray90, _renderer.evenFill, _renderer.mediumStroke, _renderer.evenOpacity);
